import React from "react";
import styled from "styled-components";
import '../App.css';

const Title = styled.div`

    color:#FFFFFF;
    font-family: "Montserrat";
    font-size: 40px;
    font-weight: 600;
    line-height: 19px;
    text-align: left;
    
    height:33px;

`;

const Subtitle = styled.div`

    color:#FFFFFF;
    font-family: Montserrat;
    font-size: 20px;
    font-weight: 300;
    line-height: 19px;
    text-align: left;
 
`;


const Head = (props:any) => {



    return(
        <div style={{display:'flex', backgroundColor:"#0F52BA", width:"100%", height:"101px", alignItems:'center', justifyContent: 'space-between', padding:'20px 40px', boxSizing:'border-box'}}>
            <div style={{display:'flex', justifyContent:'space-between', alignItems:'baseline'}}>
                <Title style={{}}>
                    MKS&nbsp;
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
            </div>      
            <div style={{display:'flex', justifyContent:'space-between', backgroundColor:'red', alignItems:'baseline'}}>
                <Title style={{}}>
                    MKS&nbsp;
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
            </div>    
        </div>
    )

}

export default Head;
